-- Dot Printer
dotPrinter :: Int -> Int-> Prog
dotPrinter x y = [Pen Up, Move x y, Pen Down, Move (x+1) (y), Move (x+1) (y+1), Move (x) (y+1), Move(x) (y) , Move (x+1) (y)]

